column31:
I Need the following API 

*  *The first API will provide me a count and status of Inactive tills.* 
API format:

Active Case: 

{code:json}{
"status": "Success",
"message": "Record Fetched Successfully",
"code": "0000",
"data":{
    "status": "Active",
    "count": 0
    }
}{code}

Inactive Case: 

{code:json}{
"status": "Success",
"message": "Record Fetched Successfully",
"code": "0000",
"data": {
      "status": "Inactive",
      "count": 2
    }
}{code}



